import React from "react";
import { FaUserCircle } from "react-icons/fa";

const Header = () => {
  return (
    <div className="Header">
      <div className="App-logo">
        <div className="Content">
          <img src="/images/premium-logo-black@3x.png" alt="logo Premium" />
        </div>
      </div>
      <div className="Icons">
        <img src="/images/fr@2x.png" alt="Language Icon" className="sidebar-icon" />
        <img src="/images/picto-utilisateur-connecte@3x.png" alt="User Icon" className="sidebar-icon" />
      </div>
    </div>
  );
};

export default Header;
